function House(){

    const title = {
        color: '#fafafa',
        fontSize: 21,
        fontWeight: 'bold',
        padding: 10,
        };
    const description = {
        color: '#fafafa',
        fontSize: 12,
    }
    const container = {
        backgroundColor: '#1B263B',
        alignItems: 'center',
        justifyContent: 'center',
        flexBasis: 100,
        margin: 10,
    }
    return  <div style={container}>
        <h1 style={title}>House</h1>
        <p style={description}>Different types of houses</p>
    </div>;
}
export default House;
